import React from 'react';


export const CheckboxProton = ({ changeCheckedType, id, name, checked }) => {
  return (
    <div className="checkbox">
      <label>
        {name}
        <input
          type="checkbox"
          checked={checked}
          onChange={() => changeCheckedType(id)}
        />
      </label>
    </div>
  );
};
